import React, { Component } from "react";
import { Card, CardBody, Media } from "reactstrap";

export class ComentariosDetalle extends Component {
  render() {
    const { tarjetas, link_id } = this.props;

    return (
      <div>
        <Card>
          <CardBody>
            <h3>Comentarios</h3>
            <h6>Comentarios de esta tarjeta</h6>
          </CardBody>
        </Card>
      </div>
    );
  }
}

export default ComentariosDetalle;
